</code></pre>","tags":["Coding"]},{"location":"blog/Tutorial/mkdocs/mkdocs-github-actions-build/","title":"如何使用 Github Actions 部署 mkdocs","text":"<p>正如大家所见,我的博客使用的是 mkdocs + mkdocs-material + Giscus 评论系统的组合. 正当我想从 Marketplace 寻找一个可以部署 mkdocs 的评论系统时,发现全部是为 mkdocs 作为项目文档制作的,部署在 gh-pages 分支上的 Action.</p> <p>于是我萌生了写一个的想法.</p> <p>本 Action 可以构建静态网页,commit到github根目录(给netlify用)</p> <p>(有些小bug)</p> <pre><code>name: Deploy mkdocs
on:
push:
paths:
- 'mkdocs-src/**'
workflow_dispatch:
jobs:
build:
runs-on: ubuntu-latest
steps:
- name: setup python
uses: actions/setup-python@v4
with:
python-version: '3.10'
- name: install
run: |
pip install mkdocs-material
- name: build static
run: |
git clone 你的仓库地址 
cd 你的用户名.github.io
shopt -s extglob
rm -rf !(README.md|mkdocs-src|.git|.github)
git init
cd mkdocs-src
mkdocs build
cd site
mv -f * ../..
git config --global user.email "你的Github邮箱"
git config --global user.name "你的Github昵称"
git add --all
git commit -m "deploy automatically by github actions"
- name: push
run: |
cd find-nick.github.io
git init
git remote rm origin
git remote add origin https://${{ secrets.MKDOCS_TOKEN }}@你的仓库地址
git push --set-upstream origin main
</code></pre> <p>使用时需注意要在 Github 的 Settings->Developer settings->Personal access tokens->Token(classic) 中申请一个Token,只需要把 <code>repo</code> 勾上即可.</p> <p>申请Token</p> <p></p> <p>然后复制token,到<code>你的用户名.github.io</code>仓库中建立一个新的 Secret(仓库Settings->Security->Actions->New repository secret). (位于<code>https://github.com/你的用户名/你的用户名.github.io/settings/secrets/actions/new</code>)</p> <p>Name 填 MKDOCS_TOKEN,Secret 填 你刚刚复制的Token.</p> <p>然后就可以愉快的写博客了:D</p>","tags":["mkdocs","Github-Actions"]},{"location":"link/","title":"链接","text":"<p>链接</p> <p> 洛谷  GitHub  Hydro OJ</p>"},{"location":"note/","title":"HI!","text":"<p>看来你发现了新大陆</p>"},{"location":"note/how-to-choose-opensource-license/","title":"哪个开源许可证?","text":"","tags":["note"]},{"location":"note/how-to-choose-opensource-license/#mermaid","title":"学习mermaid的第一课","text":"<pre><code>
