</code></pre>","tags":["solution"]},{"location":"sol/P1152/#1_2","title":"样例输出 #1","text":"<pre><code>Jolly
</code></pre>","tags":["solution"]},{"location":"sol/P1152/#2","title":"样例 #2","text":"","tags":["solution"]},{"location":"sol/P1152/#2_1","title":"样例输入 #2","text":"<pre><code>5 1 4 2 -1 6
</code></pre>","tags":["solution"]},{"location":"sol/P1152/#2_2","title":"样例输出 #2","text":"<pre><code>Not jolly
</code></pre>","tags":["solution"]},{"location":"sol/P1152/#_5","title":"提示","text":"<p>\(1 \le n \le 1000\)</p> <p>很简单,用 \(sol\) 数组把绝对值存一下,然后排序即可. 最后判断是否和 \(1~(n-1)\) 相等,不相等直接输出 <code>Not jolly</code> 然后跳出即可.</p> <pre><code>// Author: Find-NICK
// Problem: P1152 欢乐的跳
// Contest: Luogu
// URL: https://www.luogu.com.cn/problem/P1152
// Memory Limit: 125 MB
// Time Limit: 1000 ms

#include <algorithm>
#include <bitset>
#include <cctype>
#include <cerrno>
#include <clocale>
#include <cmath>
#include <complex>
#include <csignal>
#include <cstdio>
#include <cstdlib>
#include <cstring>
#include <ctime>
#include <fstream>
#include <functional>
#include <iomanip>
#include <ios>
#include <iosfwd>
#include <iostream>
#include <istream>
#include <limits>
#include <list>
#include <map>
/*Note:use unordered_map instead of map can be more fast.*/
#include <ostream>
#include <queue>
#include <set>
#include <sstream>
#include <stack>
#include <string>
#include <vector>

#define INF 0x3f3f3f3f
#define REAL_INF 2147483647
#define MAXN 100
#define CRASH raise(SIGSEGV)
#define CRASH_WITH_ABORT abort()
#define CLOSE                    \
    ios::sync_with_stdio(false); \
    cin.tie(0);                  \
    cout.tie(0);
#define isd(c) ('0' <= (c) && (c) <= '9')
#define isa(c) ('a' <= (c) && (c) <= 'z')
#define isA(c) ('A' <= (c) && (c) <= 'Z')
#define lowbit(x) (x & -x)
#define minus(x) ((~x) + 1)
#define mod2pow(x, y) (x & (y - 1)) /*can only work when b = 2 ^ (...)*/
#define bitabs(x) \
    ((x ^ (x >> (sizeof(x) * 8 - 1))) - (x >> (sizeof(x) * 8 - 1)))
#define mem(x, y) memset(x, y, sizeof x)
#define endl "\n"
#define PI acos(-1)

using namespace std;
int num[1005],sol[1005];
int main() {
/*code*/
int n;
scanf("%d", &n);
for(int i=1;i<=n;i++){
scanf("%d",&num[i]);
if(i==1){
continue;//跳过
}
sol[i-1]=abs(num[i]-num[i-1]);
}
sort(sol+1,sol+n);
for(int i=1;i<=n-1;i++){
if(sol[i]!=i){
printf("Not jolly");
return 0;
}
}
printf("Jolly");
return 0;
}
</code></pre>","tags":["solution"]},{"location":"tools/","title":"Index of tools","text":""},{"location":"tools/#downgit","title":"DownGit","text":"<p>Download any github repo's folder!</p> <p>Take me there</p>"},{"location":"tools/#notedown","title":"NoteDown","text":"<p>My favorite online markdown editor.</p> <p>Take me there</p>"},{"location":"tools/#compress-your-c-code","title":"Compress your c++ code","text":"<p>Compress your c++ code online!</p> <p>Take me there</p>"},{"location":"index-all/","title":"全站索引","text":""},{"location":"index-all/#coding","title":"Coding","text":"<ul> <li>Hello,World!</li> </ul>"},{"location":"index-all/#github-actions","title":"Github-Actions","text":"<ul> <li>如何使用 Github Actions 部署 mkdocs</li> </ul>"},{"location":"index-all/#mkdocs","title":"mkdocs","text":"<ul> <li>如何使用 Github Actions 部署 mkdocs</li> </ul>"},{"location":"index-all/#note","title":"note","text":"<ul> <li>如何选择开源许可证</li> </ul>"},{"location":"index-all/#solution","title":"solution","text":"<ul> <li>P1152</li> </ul>"}]}
