#include <sstream>
#include <stack>
#include <string>
#include <vector>

#define INF 0x3f3f3f3f
#define REAL_INF 2147483647
#define MAXN 100
#define CRASH raise(SIGSEGV)
#define CRASH_WITH_ABORT abort()
#define CLOSE                    \
    ios::sync_with_stdio(false); \
    cin.tie(0);                  \
    cout.tie(0);
#define isd(c) ('0' <= (c) && (c) <= '9')
#define isa(c) ('a' <= (c) && (c) <= 'z')
#define isA(c) ('A' <= (c) && (c) <= 'Z')
#define lowbit(x) (x & -x)
#define minus(x) ((~x) + 1)
#define mod2pow(x, y) (x & (y - 1)) /*can only work when b = 2 ^ (...)*/
#define bitabs(x) \
    ((x ^ (x >> (sizeof(x) * 8 - 1))) - (x >> (sizeof(x) * 8 - 1)))
#define mem(x, y) memset(x, y, sizeof x)
#define endl "\n"
#define PI acos(-1)

using namespace std;
int num[1005],sol[1005];
int main() {
/*code*/
int n;
scanf("%d", &n);
for(int i=1;i<=n;i++){
scanf("%d",&num[i]);
if(i==1){
continue;//跳过
}
sol[i-1]=abs(num[i]-num[i-1]);
}
sort(sol+1,sol+n);
for(int i=1;i<=n-1;i++){
if(sol[i]!=i){
printf("Not jolly");
return 0;
}
}
printf("Jolly");
return 0;
}
